import React from 'react';

const Header = () => {
    return (
        <header>
            <nav>
                <div className="nav-left">
                    <a href='#brand'>Hotel Name</a>
                </div>
                <div className="nav-right">
                    <a href='#'>Rooms</a>
                    <a href='#'>Restaurant</a>
                    <a href='#'>About</a>
                    <a href='#'>Blog</a>
                    <a href='#'>Contact</a>
                </div>
            </nav>
        </header>
    )
}

export default Header;
